class PluginBase:
    OFFICIAL_NAME = "Official"

    author = OFFICIAL_NAME
    is_official = True
    name = None
    id = None
    icon = ""
    plugin_type = "Traces"
    create_by = OFFICIAL_NAME
    update_by = OFFICIAL_NAME
    short_description = ""
    description_md = None
    deployment = None
    access_md = ""
    tags = []

    @classmethod
    def to_json(cls):
        return {
            "name": cls.name,
            "plugin_type": cls.plugin_type,
            "create_by": cls.create_by,
            "update_by": cls.update_by,
            "short_description": cls.short_description,
            "description_md": cls.description_md,
            "deployment": cls.deployment,
            "tags": cls.tags,
            "author": cls.author,
            "id": cls.id,
            "is_official": cls.is_official,
            "icon": cls.icon,
            "access_md": cls.access_md,
        }


class Opentelemetry(PluginBase):
    name = "Opentelemetry"
    id = "opentelemetry"
    tags = ["opentelemetry", "Traces", _("应用性能监控"), _("服务")]
    short_description = _(
        "OpenTelemetry（也称为 OTel）是一个开源可观测能力框架，由一系列工具、API 和 SDK 组成，" "使用户能够检测、生成、收集和导出远程监测数据以进行分析和了解软件性能和行为。"
    )
    description_md = _(
        """在云原生技术堆栈中，分布式和多语言架构是常态。分布式架构引入了各种运营挑战，包括如何快速解决可用性和性能问题。这些挑战导致了可观察性的兴起。
需要遥测数据来支持可观测性产品。传统上，遥测数据由开源项目或商业供应商提供。由于缺乏标准化，最终结果是缺乏数据可移植性和用户维护仪器的负担。
OpenTelemetry 项目通过提供与供应商无关的单一解决方案来解决这些问题。该项目得到了云提供商、供应商和最终用户的广泛行业支持和采用。

# OpenTelemetry 为您提供：

- 每种语言都有一个与供应商无关的仪器库，支持自动和手动仪器。
- 可以以多种方式部署的单个收集器二进制文件，包括作为代理或网关。
- 用于生成、发出、收集、处理和导出遥测数据的端到端实现。
- 完全控制您的数据，能够通过配置将数据并行发送到多个目的地。
- 开放标准语义约定，以确保与供应商无关的数据收集
- 能够并行支持多种上下文传播格式，以帮助随着标准的发展进行迁移。
- 无论您在可观察性旅程中的哪个位置，都是一条前进的道路。由于支持各种开源和商业协议、格式和上下文传播机制，并为 OpenTracing 和 OpenCensus 项目提供 shim，因此很容易采用 OpenTelemetry。"""
    )
    access_md = _(
        """# 注意事项

- SDK的属性设置，类型必须一致，不然会出现入库失败的情况

# 使用方法
不同云区域的Push url地址

```
{push_url}
```

[opentelemetry官方文档](https://opentelemetry.io/)

# SDK配置

python

[python-SDK](https://github.com/open-telemetry/opentelemetry-python)

```
from opentelemetry import trace
from opentelemetry.sdk.trace import TracerProvider
from opentelemetry.sdk.trace.export import BatchSpanProcessor
from opentelemetry.exporter.otlp.proto.grpc.trace_exporter import OTLPSpanExporter
otlp_exporter = OTLPSpanExporter(endpoint="grpc 上报服务地址)
span_processor = BatchSpanProcessor(otlp_exporter)
tracer_provider = TracerProvider(
    resource=Resource.create(
        {{
            "service.name": "你的服务名称",
            "bk.data.token": "{{secureKey}}",
            "net.host.name": "your 服务所在的主机名称",
            "net.host.ip": "your 服务所在主机IP",
            "net.host.port": "your 服务监听的端口"
        }}
    )
)
tracer_provider.add_span_processor(span_processor)
trace.set_tracer_provider(tracer_provider)
```"""
    )
    icon = "data:image/svg+xml;base64,"  # noqa


class PluginEnum(FancyEnum):
    OPENTELEMETRY = Opentelemetry
